INSERT INTO `article` (`id`, `Title_a`, `Caption`, `Header`, `Content`, `Thumbnail_Url`, `FK_Article_Category`, `Mata_Tag_Title`, `Mata_Tag_Description`, `Mata_Tag_Keywords`, `Publish_Date`, `Create_Date`, `Create_By`, `Update_Date`, `Update_By`, `Active`, `Delete_Date`, `Delete_By`, `view`, `tag`, `edate`) VALUES
(23, 'โตโยต้าส่งปิกอัพไปญี่ปุ่น', NULL, NULL, '<p>นายมิจิโนบุ ซึงาตะ เจ้าหน้าที่บริหารบริษัท โตโยต้า มอเตอร์ คอร์ปอเรชั่น กรรมการผู้จัดการใหญ่ บริษัท โตโยต้า มอเตอร์ ประเทศไทย จำกัด กล่าวว่า ขณะนี้โตโยต้า มอเตอร์ ประเทศไทย ได้ส่งออกรถกระบะไฮลักซ์ในโครงการไอเอ็มวี (IMV) จากฐานผลิตในไทยครบ 3 ล้านคัน ไปประเทศญี่ปุ่น โดยโครงการนี้เริ่มดำเนินการครั้งแรกในปี 45 โดยบริษัท โตโยต้า มอเตอร์ ประเทศไทยฯ ได้รับความไว้วางใจจากบริษัท โตโยต้า มอเตอร์ คอร์ปอเรชั่น ประเทศญี่ปุ่น ให้ไทยเป็นฐานการผลิตรถยนต์ในโครงการไอเอ็มวี ด้วยมูลค่าลงทุนกว่า 30,000 ล้านบาท ให้ผลิตรถกระบะขนาด 1 ตัน รถยนต์<br></p><p>อเนกประสงค์ เครื่องยนต์และชิ้นส่วนอะไหล่ เพื่อรองรับความต้องการของลูกค้าภายในประเทศและส่งออกจำหน่ายไปยังทุกภูมิภาคทั่วโลกรถกระบะไฮลักซ์ในโครงการไอเอ็มวีได้เริ่มต้นผลิตและจำหน่าย รวมถึงการส่งออกสู่ตลาดโลกเป็นครั้งแรกในปี 47 ภายใต้ชื่อ “ไฮลักซ์ วีโก้” มาจนถึงปี 58 จึงได้ส่งออกรถกระบะในโครงการไอเอ็มวี เจนเนอเรชั่นที่ 2 ภายใต้ชื่อ “ไฮลักซ์ รีโว่” ทั้งนี้ รถกระบะในโครงการไอเอ็มวีผลิตจากโรงงานโตโยต้าสำโรงและขยายสู่โรงงานโตโยต้าบ้านโพธิ์ จ.ฉะเชิงเทรา</p><p><img src=\"http://localhost/thaicoastalcleanup/thaicoastalcleanup/assets/admin/blog/d846e32ad1408b21b8188b5292d4f187.jpg\" style=\"width: 100%;\"><br></p><p> </p><p>โดยปัจจุบันทั้ง 2 โรงงาน มีกำลังการผลิตรวมกันสูงสุดถึง 450,000 คันต่อปี“จากวันนั้นถึงวันนี้ นับเป็นการก้าวกระโดดครั้งสำคัญ ที่ทำให้บริษัท โตโยต้า มอเตอร์ ประเทศไทย ได้รับการยกระดับเป็นฐานการผลิตและส่งออกหลักที่สำคัญของรถกระบะขนาด 1 ตันในกลุ่มบริษัทโตโยต้า ด้วยยอดผลิตที่สูงถึง 60% ของยอดการผลิตทั่วโลก ส่งออกไปจำหน่ายกว่า 120 ประเทศทั่วโลก รวมทั้งสิ้นกว่า 3,000,000 คัน แสดงให้เห็นถึงการยอมรับในการผลิตรถยนต์คุณภาพมาตรฐานระดับโลกอย่างแท้จริงของคนไทย ปัจจุบันประเทศญี่ปุ่น มีกลุ่มลูกค้าที่ชื่นชอบรถกระบะไฮลักซ์เป็นอย่างมาก”.</p>', 'CiHZjUdJ5HPNXJ92GP7IaiBcr4zffSy1HM.jpg', 1, NULL, NULL, NULL, '2017-11-27 13:11:17', '2017-11-26 05:47:36', NULL, '2017-11-27 13:11:17', NULL, 1, '2017-11-26 05:47:36', NULL, 23, '', '0000-00-00'),
(24, 'ลดแอบอ้าง-เจอผิดตัว! เรือนจำขอนแก่น ใช้ระบบสแกนใบหน้า จองเยี่ยมนักโทษ', NULL, NULL, 'วันที่ 27 พ.ย.2560 ผู้สื่อข่าวรายงานว่า ที่เรือนจำกลางขอนแก่น ได้มีการนำระบบการเยี่ยมผู้ต้องขังรูปแบบใหม่แห่งแรกของการให้บริการของเรือนจำในภาคตะวันออกเฉียงเหนือ ด้วยการใช้ระบบสแกนใบหน้าของญาติผู้ต้องขังในการเข้าเยี่ยม เพื่อลดขั้นตอนการรอเรียกคิว การจัดลำดับการเข้าเยี่ยม รวมทั้งเป็นการป้องกันการแอบอ้างการเข้าเยี่ยมอีกด้วย', 'CiHZjUdJ5HPNXJ92GP7IrGNVYMlMLyrVmA.jpg', 2, NULL, NULL, NULL, '2017-11-27 13:20:17', '2017-11-27 05:27:07', NULL, '2017-11-27 13:20:17', NULL, 1, '2017-11-27 05:27:07', NULL, 54, '', '0000-00-00'),
(26, 'ตูน ฉลุย วิ่งผ่านหาดบ้านกรูดสูดโอโซน แหม่มจินตหรา หมอก้อง ฮั่น ร่วมแจม ', NULL, NULL, 'ตูน บอดี้สแลม เริ่มวิ่งวันที่ 26 พ.ย. ผ่านชายหาดบ้านกรูดท่ามกลางอากาศสดชื่น ใบหน้ายิ้มแย้ม ไร้อาการบาดเจ็บ มีจินตหรา สุขพัฒน์ หม้อก้อง ฮั่น เตอะสตาร์ วิ่งประกบ ทำเวลาได้ดี แฟนคลับมารอรับ ยืนกันเป็นระเบียบเรียบร้อย...เมื่อเวลา 05.00 น. วันที่ 26 พ.ย. 2560 ผู้สื่อข่าวรายงานว่า นายอาทิวราห์ คงมาลัย หรือตูน บอดี้สแลม พร้อมทีมงานก้าวคนละก้าว เพื่อ 11 โรงพยาบาลทั่วประเทศ ได้เริ่มวิ่งออกจาก กรีนซีวิว รีสอร์ต ชายหาดบ้านดอนสำราญ อ.บางสะพาน จ.ประจวบคีรีขันธ์ ด้วยสีหน้ายิ้มแย้มแจ่มใส ท่ามกลางบรรยากาศที่เย็นสบาย ก่อนมุ่งหน้าหาดบ้านกรูดโดยใช้เส้นทางเลียบชายทะเล มีประชาชน ชาว ต.ธงชัย ให้การต้อนรับอย่างอบอุ่นตลอดสองข้างทางที่คณะวิ่งผ่าน ก่อนวิ่งเข้าจุดพักเซตที่วัดธงชัยธรรมจักร ม.2 ต.ธงชัย อ.บางสะพาน ระยะทาง 13.6 กิโลเมตร โดยใช้เวลาพักประมาณ 40 นาที', 'CiHZjUdJ5HPNXJ92GP7IuYZe3CKRnUpp4D.jpg', 1, NULL, NULL, NULL, '2017-11-27 10:39:20', '2017-11-27 06:42:20', NULL, '2017-11-27 10:39:20', NULL, 1, '2017-11-27 06:42:20', NULL, 22, 'ตูน, ตูน บอดี้สแลม, ก้าวคนละก้าว, ตูนวิ่งบ้านกรูด', '2017-11-30');
