--
-- Table structure for table `icc_card`
--

CREATE TABLE `icc_card` (
  `id` int(11) UNSIGNED NOT NULL,
  `Project_Name` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'ชื่อโปรเจค',
  `FK_Cleanup_Type` int(11) NOT NULL COMMENT 'รูปแบบของกิจกรรม',
  `Event_Place_Name` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'ชื่อสถานที่กิจกรรม',
  `FK_Amphur_Code` int(11) NOT NULL COMMENT 'รหัสอำเภอ',
  `FK_Province_Code` int(11) NOT NULL COMMENT 'รหัสจังหวัด',
  `Event_Date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'วันที่ทำกิจกรรม',
  `Coordinator_Name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'หน่วยงานที่เกี่ยวข้อง',
  `Volunteer_Qty` int(11) DEFAULT NULL COMMENT 'จำนวนอาสาสมัคร',
  `Event_Time` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'ระยะเวลาของการทำกิจกรรม',
  `Event_Distance` float DEFAULT '0' COMMENT 'ระยะทางของการทำกิจกรรม',
  `FK_Distance_Unit` int(11) DEFAULT NULL COMMENT 'หน่วยของระยะทางของการทำกิจกรรม',
  `Garbage_Bag_Qty` int(11) DEFAULT NULL COMMENT 'จำนวนถุงขยะที่ใช้ในกิจกรรม',
  `Garbage_Weight` float DEFAULT '0' COMMENT 'น้ำหนักของขยะทะเล',
  `FK_Weight_Unit` int(11) DEFAULT NULL COMMENT 'หน่วยของน้ำหนักทะเล',
  `FK_ICC_Card_Status` tinyint(3) UNSIGNED DEFAULT '1' COMMENT '1=waiting for approval, 2=Pending, 3=Done',
  `Approve_Date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'วันที่อนุมัติโครงการ',
  `Approve_By` int(11) DEFAULT NULL COMMENT 'รหัสอ้างอิงผู้ที่อนุมัติโครงการ',
  `Done_Date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'วันที่โครงการแล้วเสร็จ',
  `Done_By` int(11) DEFAULT NULL COMMENT 'รหัสอ้างอิงผู้ที่บันทึกการเสร็จสิ้นโครงการ',
  `Active` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0=Inactive, 1=Active',
  `Create_Date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'วันที่สร้างข้อมูล',
  `Create_By` int(11) DEFAULT NULL COMMENT 'รหัสอ้างอิงผู้ที่สร้างข้อมูล',
  `Update_Date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'วันล่าสุดที่แก้ไขข้อมูล',
  `Update_By` int(11) DEFAULT NULL COMMENT 'รหัสอ้างอิงผู้ที่แก้ไขข้อมูลล่าสุด',
  `Delete_Date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'เวลาที่ทำการลบเอกสาร',
  `Delete_By` int(11) DEFAULT NULL COMMENT 'รหัสอ้างอิงผู้ลบเอกสาร'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='ข้อมูลรายการ ICC Card' ROW_FORMAT=COMPACT;

